import React from 'react';
import styled from "styled-components";


const Container = styled("div")`
padding-right:60px;
flex: 1;
`;

const Search = () => {
    return (
        <>
            <Container>
                <h1>This is the text that we have in the middle</h1>
            </Container>
        </>
    );
}

export default Search;
